function app(){
  return(
    <Router>
      <div className="App">
        <h1>Get A pet</h1>
        <Switch>
          <Route path="/login" component={Login} />
          <Route path="/register" component={Register} />
        </Switch>
      </div>
    </Router>
  );
}
